import React from 'react'
import { Route,  Routes } from 'react-router-dom'
import LoginForm from './LoginForm'

const Login = () => {
    return (
        <div>
            <Routes>
            </Routes>
                <Route path='/' element={<LoginForm />}/>
        </div>
    )
}

export default Login
